-- REGION

CREATE TABLE region (
                                    name character varying(255) NOT NULL,
                                    insee_code character varying(255) NOT NULL
);



ALTER TABLE ONLY region
    ADD CONSTRAINT pk_region PRIMARY KEY (insee_code);

-- DEPARTMENT

CREATE TABLE department (
                                        name character varying(255) NOT NULL,
                                        insee_code character varying(255) NOT NULL,
                                        region_insee_code character varying(36)
);


ALTER TABLE ONLY department
    ADD CONSTRAINT pk_department PRIMARY KEY (insee_code);

ALTER TABLE ONLY department
    ADD CONSTRAINT fk_department_on_region_insee_code FOREIGN KEY (region_insee_code) REFERENCES region(insee_code);

-- CONTIGOUS DEPARTMENT

CREATE TABLE contigous_department (
                                                  department1_insee_code character varying(36) NOT NULL,
                                                  department2_insee_code character varying(36) NOT NULL
);


ALTER TABLE ONLY contigous_department
    ADD CONSTRAINT pk_contigous_department PRIMARY KEY (department1_insee_code, department2_insee_code);

CREATE UNIQUE INDEX idx_contigous_department ON contigous_department USING btree ((
    CASE
    WHEN ((department1_insee_code)::text < (department2_insee_code)::text) THEN (((department1_insee_code)::text || '*'::text) || (department2_insee_code)::text)
    ELSE (((department2_insee_code)::text || '*'::text) || (department1_insee_code)::text)
    END));

ALTER TABLE ONLY contigous_department
    ADD CONSTRAINT fk_department1_on_department_insee_code FOREIGN KEY (department1_insee_code) REFERENCES department(insee_code);


ALTER TABLE ONLY contigous_department
    ADD CONSTRAINT fk_department2_on_department_insee_code FOREIGN KEY (department2_insee_code) REFERENCES department(insee_code);

-- CITY

CREATE TABLE city (
                                  name character varying(255) NOT NULL,
                                  insee_code character varying(255) NOT NULL,
                                  department_insee_code character varying(36)
);


ALTER TABLE ONLY city
    ADD CONSTRAINT pk_city PRIMARY KEY (insee_code);

ALTER TABLE ONLY city
    ADD CONSTRAINT fk_city_on_department_insee_code FOREIGN KEY (department_insee_code) REFERENCES department(insee_code);

-- POSTAL CODE

CREATE TABLE postal_code (
    code character varying(20) NOT NULL
);


ALTER TABLE ONLY postal_code
    ADD CONSTRAINT pk_postal_code PRIMARY KEY (code);

-- POSTAL CODE CITY

CREATE TABLE postal_code_cities (
    postal_code character varying(255) NOT NULL,
    city_insee_code character varying(36) NOT NULL
);


ALTER TABLE ONLY postal_code_cities
    ADD CONSTRAINT pk_postal_code_cities PRIMARY KEY (city_insee_code, postal_code);

ALTER TABLE ONLY postal_code_cities
    ADD CONSTRAINT fk_postal_code_cities_on_postal_code FOREIGN KEY (postal_code) REFERENCES postal_code(code);

ALTER TABLE ONLY postal_code_cities
    ADD CONSTRAINT fk_postal_code_on_city_insee_code FOREIGN KEY (city_insee_code) REFERENCES city(insee_code);